import Qs from "qs";
import { getTimeDate } from "@/utils/index.js";
import UserInfo from "./infoDialog";
export default {
  components: {
    UserInfo: UserInfo
  },
  filters: {
    statusFilter: function statusFilter(status) {
      var statusMap = {
        未使用: "success",
        已使用: "gray"
      };
      return statusMap[status];
    }
  },
  data: function data() {
    return {
      currentPage: 1,
      pageSize: 10,
      total: 0,
      dialogTableVisible: false,
      selectTaskData: {},
      list: [],
      listLoading: true,
      form: {
        num: "",
        status: "未使用"
      },
      rules: {
        userId: [{
          required: true,
          trigger: "blur",
          message: "请输入账号ID"
        }]
      }
    };
  },
  created: function created() {
    this.fetchData();
  },
  methods: {
    formatTime: function formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    submitForm: function submitForm(formName) {
      var _this = this;

      this.$prompt("请输入生成数量", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        inputPattern: /^\+?[1-9]\d*$/,
        inputErrorMessage: "请输入数字"
      }).then(function (_ref) {
        var value = _ref.value;
        var param = {
          num: value
        };

        _this.axios.post(_this.urls.addinvitation + "?" + Qs.stringify(param)).then(function (response) {
          _this.fetchData();
        });
      }).catch(function () {});
    },
    fetchData: function fetchData() {
      var _this2 = this;

      this.listLoading = true;
      var page = {
        pageNumber: this.currentPage,
        pageSize: this.pageSize
      };
      var param = {
        status: this.form.status,
        _uiName_: "eleme",
        _pagination: JSON.stringify(page)
      };
      this.axios.get(this.urls.invitationlist + "?" + Qs.stringify(param)).then(function (response) {
        _this2.list = response.data.list;
        _this2.total = response.data.totalRow;
        _this2.listLoading = false;
      });
    },
    handleSizeChange: function handleSizeChange(val) {
      this.pageSize = val;
      this.fetchData();
    },
    handleCurrentChange: function handleCurrentChange(val) {
      this.currentPage = val;
      this.fetchData();
    },
    //查询
    lookinfo: function lookinfo(row, index) {
      this.dialogTableVisible = true;
      this.selectTaskData = row;
    },
    editDialogListener: function editDialogListener(bol) {
      this.dialogTableVisible = bol;
    }
  }
};
